import React, { useState, useEffect } from 'react';

const UserDashboard = ({ user_Data }) => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const fetchUserById = async () => {
    try {
      const response = await fetch(`/users/${user_Data.id}`, {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
        },
      });

      let data; // Declare data variable

      if (response.ok) {
        data = await response.json();
        console.log('User data:', data.user);

        // Further processing with 'data'

      } else {
        console.error('Error fetching user data:', response.statusText);
        setError('Error fetching user data.');
        setLoading(false);
      }
    } catch (error) {
      console.error('Error fetching user:', error);
      setError('Something went wrong. Please try again.');
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchUserById();
  }, [user_Data]);

  return (
    <div>
      <h1>User Dashboard</h1>
      {loading && <p>Loading user data...</p>}
      {error && <p>{error}</p>}
      {user_Data && (
        <div>
          <h2>User Information</h2>
          <p>ID: {user_Data.id}</p>
          <p>First Name: {user_Data.first_name}</p>
          <p>Last Name: {user_Data.last_name}</p>
          <p>Username: {user_Data.username}</p>
          <p>Email: {user_Data.email}</p>
        </div>
      )}
    </div>
  );
};

export default UserDashboard;
